import React from 'react';


function Dramatic() {
    return (
        <div>
            <h1>Your style type is Dramatic. </h1>
            <img alt="" src="https://www.proprofs.com/api/ckeditor_images/New%20Project%20(13)(51).jpg" />
            <h3 className='resultDescr'>Your Dramatic style often intimidates and intrigues. You can appear sensual and seductive or sophisticated but striking.</h3>
        </div>
    );
};



export default Dramatic;
